import "./reserveTutorscr.css"

import { useState } from 'react';

const tutors = [
  { id: 1, name: 'Martin Smith' },
  { id: 2, name: 'Test9 Smith' },
  { id: 3, name: 'wass Johnson' },
  { id: 4, name: 'Test229 Smith' },
  { id: 5, name: 'Layla Smith' },
  { id: 6, name: 'test222 Johnson' },
  { id: 7, name: 'Test9 Johnson' },
  { id: 8, name: 'Test2129 Smith' },
  { id: 9, name: 'Test29 Smith' },
  { id: 10, name: '1wass Johnson' },
  { id: 11, name: 'test222 Smith' },
  { id: 12, name: 'test222 Smith' },
  { id: 13, name: 'Test5 Johnson' },
  { id: 14, name: 'Test9 Johnson' },
  { id: 15, name: 'Test29 Smith' },
  { id: 16, name: 'Test5 Smith' },
  { id: 17, name: 'Test29 Johnson' },
  { id: 18, name: 'Test9 Smith' },
  { id: 19, name: 'Test929 Smith' },
  { id: 20, name: 'Test229 Johnson' },
  { id: 21, name: '2wass Johnson' },
  { id: 22, name: 'Test Smith' },
  { id: 23, name: 'Test5 Smith' },
  { id: 24, name: 'Test9 Johnson' },
  { id: 25, name: 'Test29 Smith' },
  { id: 26, name: 'Jane Smith' },
  { id: 27, name: 'Bob Johnson' },
  { id: 28, name: 'Bob Johnson' },
  { id: 29, name: 'Martin Smith' },
  { id: 30, name: 'Jane Smith' },
  { id: 31, name: 'Bob Johnson' },
  { id: 32, name: 'Martin Smith' },
  { id: 33, name: 'Jane Smith' },
  { id: 34, name: 'Bob Johnson' },
  { id: 35, name: 'Bob Johnson' },

];

const subjects = [
  { id: 1, name: 'Integral Calculus' },
  { id: 2, name: 'Linear Algebra' }
];

const apiUrl = 'https://x4g0ddpp1f.execute-api.us-east-2.amazonaws.com/prod/Create/reservations';

function ReserveTutorPage() {
  const [tutorId, setTutorId] = useState(null);
  const [date, setDate] = useState('');
  const [time, setTime] = useState('');
  const [duration, setDuration] = useState('');
  const [subjectId, setSubjectId] = useState(null);

  function handleSubmit(event) {
    event.preventDefault();
    const reservation = {
      tutor_id: tutorId,
      student_id: 2, // hardcoded for simplicity
      date,
      subject_id: subjectId,
      time,
      duration,
      status: 'Incomplete',
    };
    fetch(apiUrl, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(reservation),
    })
      .then(response => {
        if (response.ok) {
          alert('Reservation created successfully!');
          setTutorId(null);
          setDate('');
          setTime('');
          setDuration('');
          setSubjectId(null);
        } else {
          throw new Error('Failed to create reservation');
        }
      })
      .catch(error => {
        console.error(error);
        alert('Failed to create reservation');
      });
  }

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Select a tutor:
        <select value={tutorId} onChange={event => setTutorId(parseInt(event.target.value))}>
          <option value="">-- Choose a tutor --</option>
          {tutors.map(tutor => (
            <option key={tutor.id} value={tutor.id}>
              {tutor.name}
            </option>
          ))}
        </select>
      </label>
      <br />
      <label>
        Select a subject:
        <select value={subjectId} onChange={event => setSubjectId(parseInt(event.target.value))}>
          <option value="">-- Choose a subject --</option>
          {subjects.map(subject => (
            <option key={subject.id} value={subject.id}>
              {subject.name}
            </option>
          ))}
        </select>
      </label>
      <br />
      <label>
        Select a date:
        <input type="date" value={date} onChange={event => setDate(event.target.value)} />
      </label>
      <br />
      <label>
        Select a time:
        <input type="time" value={time} onChange={event => setTime(event.target.value)} />
      </label>
      <br />
      <label>
        Select duration (in hours):
        <input type="number" min="1" step="0.5" value={duration} onChange={event => setDuration(event.target.value)} />
      </label>
      <br />
      <button type="submit" disabled={!tutorId || !subjectId || !date || !time || !duration}>
        Reserve
      </button>
    </form>
  );
}
export default ReserveTutorPage;
